import React from 'react';
import { Table, Button } from 'reactstrap';

export default (props) =>{

    return(
<div>
        <Table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Nome</th>
            <th>Preço de custo</th>
            <th>Preço de venda</th>
          </tr>
        </thead>
        <tbody>

        </tbody>
      </Table>


<Button color="secondary">Atualizar preço</Button>{' '}
</div>
    )
}
